class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        # 从左往右扫描,每一个start只对应一个局部最优解,因此,每次找到一个解就将start+1,
        source = [0] * 256
        target = [0] * 256
        ns, nt = len(s), len(t)
        for ch in t:
            # print('ch', ch)
            target[ord(ch)] += 1

        start, flag, win, first = -1, nt, ns + 1, -1
        for ch in range(ns):
            od = ord(s[ch])
            # print('od', s[ch], 'flag', flag)

            if target[od] > source[od]:
                # 发现一个新的目标字符
                flag -= 1
                # print('找到共有字符', s[ch], flag)
            source[od] += 1
            if flag == 0:#找到一个解

                start += 1
                # if start >= ns:
                #     break
                stach = ord(s[start])
                print('开始删除字符', s[start])
                print(target[stach])
                while target[stach] == 0 or (target[stach] != 0 and target[stach] < source[stach]):
                    print('---', s[start], start, target[stach], source[stach])
                    if target[stach] < source[stach]:
                        print('去除字符', s[start])
                        source[ord(s[start])] -= 1
                        start += 1
                        stach = ord(s[start])
                flag += 1
                if win > ch - start:
                    win = ch - start + 1
                    first = start
                    print('找到一个解', s[first:first + win])
                    print('find solution', s[first:first + win], s[start: ch + 1], start, ch)
                    # if win == nt:
                    #     break
                # if start >= ns:
                #     break
                source[ord(s[start])] -= 1
                # print('未删除', s[start], flag, source[ord('A')], source[ord('B')], source[ord('C')])
        if win == ns + 1:
            return ""
        return s[first:first+win]









